import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { HomeStackScreen, AboutStackScreen, HelpStackScreen } from "./StackNavigator";
import HelpScreen from './screens/Help';
import styles from '../../assets/styles/index.js';

const Tab = createBottomTabNavigator();

const BottomTabNavigator = () => {
  return (
    // <Tab.Navigator tabBar={props => <BottomNav {...props} />}>
    <Tab.Navigator
      style={styles.tabButton}
      initialRouteName="About"
      tabBarOptions={{
      activeTintColor: '#5341AF',
      inactiveTintColor: '#A9A0D7',
      }}>
        <Tab.Screen name="About" 
          component={AboutStackScreen}
          options={{
          tabBarLabel: 'About',
          tabBarAccessibilityLabel: 'About Page',
          accessibilityRole: "button",
          // tabBarIcon: ({ color, size }) => (
          //   <MaterialCommunityIcons name="home" color={color} size={size} />
          // ),
          }}
        />
        <Tab.Screen name="Home" 
          component={HomeStackScreen} 
          options={{
          tabBarLabel: 'Home',
          tabBarAccessibilityLabel: 'Home Page',
          // tabBarIcon: 
          // ),
          }}
        />
        <Tab.Screen name="Help" 
          component={HelpScreen} 
          options={{
          tabBarLabel: 'Help',
          tabBarAccessibilityLabel: 'Help Page',
          // tabBarIcon: ({ color, size }) => (
          //   <MaterialCommunityIcons name="account" color={color} size={size} />
          // ),
          }}
        />
    </Tab.Navigator>
  );
};

export default BottomTabNavigator;
